import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
    return (
        <div>
            <navbar>
                <Link to={'/home'}>
                    Home Page
                </Link>
                <Link to={'/connects'}>
                    Connects
                </Link>
                <Link to={'/blogs'}>
                    Blogs
                </Link>
            </navbar>

            <h1>
                Home Page
            </h1>
        </div>
    );
}

export default Home;
